import React from "react";
import "./Header.css";
import $ from "jquery";
const Header = () => {
  const tabs = $(".tabs > li");

  tabs.on("click", function () {
    tabs.removeClass("active");
    $(this).addClass("active");
  });
  return (
    <>
      <div className="header">
        <div className="header-top">
          <div className="d-flex justify-content-end px-2 py-3 ">
            <div className="px-2">1</div>
            <div className="px-2">2</div>
            <div className="px-2">3</div>
            <div className="px-2">
              <button className="split-button">split view</button>
            </div>
          </div>
        </div>
        <div className="header-bottom">
          <div className="tab">
            <div className="tab-container">
              <ul className="tabs clearfix">
                <li>
                  <a href="#">Users</a>
                </li>
                <li className="active">
                  <a href="#">Pending Lots</a>
                </li>
                <li>
                  <a href="#">Nearby Lots</a>
                </li>
                <li>
                  <a href="#">Recent Lots</a>
                </li>
              </ul>
            </div>
            <div className="outer-circle"></div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Header;
